import { ListItem, ListItemAvatar, ListItemText } from "@mui/material";
import Avatar from "@mui/material/Avatar";
import Typography from "@mui/material/Typography";
import React from "react";



type ChatItemListProps = {
    room: string
    joined: boolean;
};


const ChatListItem: React.FC<ChatItemListProps> = ({ room }) => {
    const description = `This is the ${room} group chat`;


    return (
        <ListItem alignItems="flex-start">
            <ListItemAvatar>
                <Avatar alt={room} src="random" />
            </ListItemAvatar>
            <ListItemText

                primary={
                    <Typography
                        component="div"
                        variant="h5"
                        color="primary"
                        sx={{ display: 'inline' }}
                    >
                        {room}
                    </Typography>

                }
                secondary={
                    <React.Fragment>
                        <Typography
                            component="span"
                            variant="subtitle1"
                            color="secondary"
                            sx={{ display: 'inline' }}
                        >
                            {description}
                        </Typography>
                        {' — Do you have Paris recommendations? Have you ever…'}
                    </React.Fragment>
                }
            />
        </ListItem>
    );
}

export default ChatListItem;
